import RoutesApp from "./Routes";
import Login from "../pages/Login/Login";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Login>
        <RoutesApp />
      </Login>
    </BrowserRouter>
  );
}
export default App;
